  false,\n\t\"url\": null,\n\t\"notes\": \"In 1970 the red-cockaded woodpecker (Picoides
  borealis) was federally listedas an endangered species and received protection under
  the 1973Endangered Species Act as amended. Since that time, two recovery plans(
  1979, 1985) have been developed to facilitate the management of thespecies. More
  recently, suits have been filed against the Forest Service forfailure to adequately
  manage and protect the RCW. Because of a greaterpublic awareness and increased biological
  interest in this species, it isimportant to disseminate information on recent advances
  in managementtechniques to managers.This report overviews management and research
  activities on red-cockadedwoodpeckers conducted at Noxubee National Wildlife Refuge
  and details theyears 1987-1991. Prior to this date, relatively little management
  wasundertaken by the refuge for specific management of the RCW other thanperiodic
  (2-4 year) prescribed burns of pine stands. However, during thepast five years increased
  emphasis has been placed on managing thisspecies at Noxubee NWR, due in part to
  public concern, advances inmanagement techniques, recognition of obligation to the
  Endangered SpeciesAct resulting from suits against the U.S. Forest Service, and
  interest byrefuge employees. The purpose of the report is to highlight Noxubee'srecent
  advances and make other managers aware of these activities so theymight incorporate
  them into their respective management for red-cockadedwoodpeckers.\",\n\t\"owner_org\":
